import React from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Navbar from "../components/Navbar";
import logodepartment from "../img/logo/logodepartment.png";
import TextField from "@mui/material/TextField";
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import { Link } from "react-router-dom";
import LockOpenIcon from '@mui/icons-material/LockOpen';
import PersonAddIcon from '@mui/icons-material/PersonAdd';

const CssTextField = styled(TextField)({
    '& label.Mui-focused': {
      color: 'white',
    },
    '& .MuiInput-underline:after': {
      borderBottomColor: 'black',
    },
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: 'white',
      },
      '&:hover fieldset': {
        borderColor: 'yellow',
      },
      '&.Mui-focused fieldset': {
        borderColor: 'black',
      },
    },
  });

  const ColorButton = styled(Button)(({ theme }) => ({
    color: theme.palette.getContrastText('#ffffff'),
    backgroundColor: "#ffffff",
    '&:hover': {
      backgroundColor: "#8C61FF",
    },
  }));

function PageLogin() {
  return (
    <div>
      <Navbar />
      <Box
        sx={{
          height: "80vh",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          flexDirection: "column",
        }}
      >
        <Box
          sx={{
            top: "50%",
            left: "50%",
            background: "#6592FD",
            width: "100%",
            maxWidth: 700,
            height: "100%",
            maxHeight: 400,
            display: "flex",
            justifyContent: "center",
            flexDirection: "column",
            textAlign: "center",
            borderRadius: "10px",
            borderStyle: "solid",
          }}
        >
          <Box>
            <Typography
              variant="subtitle1"
              sx={{ color: "#ffffff", fontWeight: "bold", fontSize: "24px" ,marginTop}}
            >
              เข้าสู่ระบบ
            </Typography>
          </Box>
          <Box
            sx={{
              display: "flex",
             
            
            }}
          >
            <Box sx={{ display: "flex" }}>
              <Box>
                <img
                  src={logodepartment}
                  alt="img"
                  style={{ width: "200px", height: "200px" }}
                />
              </Box>
            </Box>
            <Box
              sx={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                flexDirection: "column",
                width: "100%",
              }}
            >
                <Box sx={{padding:'10px', width: "100%",}}>
                <CssTextField fullWidth label="E-mail RTAF" id="fullWidth" placeholder="(ไม่ต้องใส่ @ rtaf.mi.th)"/>
                </Box>
                <Box sx={{padding:'10px', width: "100%",}}>
                <CssTextField fullWidth label="Password" id="fullWidth" />
                </Box>
                <Box sx={{display: "flex"}}>
                    <Box sx={{margin:'10px'}}>
                    <Link to="/PageHome" style={{ textDecoration: "none" }}>
                    <ColorButton startIcon={<LockOpenIcon />} variant="contained">Sign In</ColorButton>
                    </Link>
                    </Box>
                    <Box sx={{margin:'10px'}}>
                    <Link to="/PageSignUp" style={{ textDecoration: "none" }}>
                    <ColorButton startIcon={<PersonAddIcon />} variant="contained">Sign Up</ColorButton>
                    </Link>
                    </Box>
                </Box>
            </Box>
          </Box>
        </Box>
      </Box>
    </div>
  );
}

export default PageLogin;
